import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { createProperty, getPropertyEnums } from '../api/propertyService';
import '../styles/CreatePropertyForm.css';

const CreatePropertyForm = () => {
    const navigate = useNavigate();
    const [formData, setFormData] = useState({
        address: {
            city: '',
            street: '',
            building: ''
        },
        rooms: '',
        price: '',
        floor: '',
        propertyLevel: '',
        description: '',
        propertyType: '',
        status: 'AVAILABLE'
    });

    const [enumValues, setEnumValues] = useState({
        propertyTypes: [],
        propertyLevels: [],
        statuses: []
    });
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');

    useEffect(() => {
        const fetchEnums = async () => {
            try {
                const data = await getPropertyEnums();
                setEnumValues({
                    propertyTypes: data.propertyTypes || [],
                    propertyLevels: data.propertyLevels || [],
                    statuses: data.statuses || []
                });
            } catch (err) {
                console.error('Ошибка загрузки enum значений:', err);
            }
        };

        fetchEnums();
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;

        if (name.includes('.')) {
            const [parent, child] = name.split('.');
            setFormData(prev => ({
                ...prev,
                [parent]: {
                    ...prev[parent],
                    [child]: value
                }
            }));
        } else {
            setFormData(prev => ({
                ...prev,
                [name]: value
            }));
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');

        try {
            // Преобразуем числовые поля
            const payload = {
                ...formData,
                rooms: parseInt(formData.rooms),
                price: parseFloat(formData.price),
                floor: parseInt(formData.floor)
            };

            await createProperty(payload);
            navigate('/properties'); // Перенаправляем после успешного создания
        } catch (err) {
            setError(err.response?.data?.message || 'Ошибка при создании недвижимости');
            console.error('Ошибка:', err);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="create-property-container">
            <h2>Добавить новую недвижимость</h2>

            {error && <div className="error-message">{error}</div>}

            <form onSubmit={handleSubmit} className="property-form">
                <div className="form-section">
                    <h3>Основная информация</h3>

                    <div className="form-group">
                        <label>Тип недвижимости:</label>
                        <select
                            name="propertyType"
                            value={formData.propertyType}
                            onChange={handleChange}
                            required
                        >
                            <option value="">Выберите тип</option>
                            {enumValues.propertyTypes.map(type => (
                                <option key={type} value={type}>{type}</option>
                            ))}
                        </select>
                    </div>

                    <div className="form-group">
                        <label>Количество комнат:</label>
                        <input
                            type="number"
                            name="rooms"
                            value={formData.rooms}
                            onChange={handleChange}
                            min="1"
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Цена:</label>
                        <input
                            type="number"
                            name="price"
                            value={formData.price}
                            onChange={handleChange}
                            min="0"
                            step="100"
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Этаж:</label>
                        <input
                            type="number"
                            name="floor"
                            value={formData.floor}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Уровень:</label>
                        <select
                            name="propertyLevel"
                            value={formData.propertyLevel}
                            onChange={handleChange}
                        >
                            <option value="">Выберите уровень</option>
                            {enumValues.propertyLevels.map(level => (
                                <option key={level} value={level}>{level}</option>
                            ))}
                        </select>
                    </div>

                    <div className="form-group">
                        <label>Статус:</label>
                        <select
                            name="status"
                            value={formData.status}
                            onChange={handleChange}
                            required
                        >
                            {enumValues.statuses.map(status => (
                                <option key={status} value={status}>{status}</option>
                            ))}
                        </select>
                    </div>

                    <div className="form-group">
                        <label>Описание:</label>
                        <textarea
                            name="description"
                            value={formData.description}
                            onChange={handleChange}
                            rows="4"
                        />
                    </div>
                </div>

                <div className="form-section">
                    <h3>Адрес</h3>

                    <div className="form-group">
                        <label>Город:</label>
                        <input
                            type="text"
                            name="address.city"
                            value={formData.address.city}
                            onChange={handleChange}
                            required
                        />
                    </div>
я
                    <div className="form-group">
                        <label>Район:</label>
                        <input
                            type="text"
                            name="address.district"
                            value={formData.address.district}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div className="form-group">
                        <label>Улица:</label>
                        <input
                            type="text"
                            name="address.street"
                            value={formData.address.street}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Номер дома:</label>
                        <input
                            type="text"
                            name="address.building"
                            value={formData.address.building}
                            onChange={handleChange}
                            required
                        />
                    </div>

                </div>

                <button type="submit" disabled={loading} className="submit-button">
                    {loading ? 'Создание...' : 'Создать недвижимость'}
                </button>
            </form>
        </div>
    );
};

export default CreatePropertyForm;
